import {BrowserRouter as Router,Route,Routes} from"react-router-dom";
import logo from './logo.svg';
import './App.css';
import About from"./Component/About";
import Contact from"./Component/Contact";
import Master from "./Masters/Master";
import Home from"./Component/Home";
import Service from"./Component/Service";
import LoginPage from './Login/LoginPage';
import { useState } from 'react';
import Feature from "./Component/Feature";
import MyData from "./MyData";

import Dashboard from "./Admin/Dashboard";
import AdminHeader from "./Admin/AHeader";
// import RegistrationForm from "./Admin/RegistrationForm";
import AMaster from "./Masters/AMaster";
import AddServices from "./Admin/AddServices";
import ViewServices from "./Admin/ViewServices";
import LMaster from "./Masters/LMaster";
import Register from "./Login/Register";

import UMaster from "./Masters/UMaster";
import UserProfile from "./User/UserProfile";
import BookingHistory from "./User/BookingHistory";
import BookingService from "./User/BookServices";
import PaymentDetails from "./User/PaymentDetails";
import StatusService from "./User/StatusServices";
import Userlogin from "./Userlogin";
