  }
  return (

    <>
    <Router>
      <Routes>

        <Route path="/" element={<Master/>}>
        <Route path="/about" element={<About/>}/>
        <Route path="/contact" element={<Contact/>}/>
        <Route path="/feature" element={<Feature/>}/>
        <Route path="/" element={<Home/>}/>
        <Route path="/service" element={<Service/>}/>
        <Route path="/userlogin" element={<Userlogin/>}/>

        </Route>


        <Route path="/admin" element={<AMaster/>}>
        {/*<Route path="/admin" element={<Dashboard/>}/>*/}
        <Route path="/admin/registrationForm" element={<RegistrationForm/>}/>
        <Route path="/admin/addservices" element={<AddServices/>}/>
        <Route path="/admin/viewServices" element={<ViewServices/>}/>
        </Route>


        <Route path="/login" element={<LMaster/>}>
        <Route path="/login" element={<LoginPage/>}/>
        <Route path="/login/register" element={<Register/>}/>
        </Route>





        <Route path="/user" element={<UMaster/>}>
        <Route path="/user/bookingHistory" element={<BookingHistory/>}/>
        <Route path="/user/bookingServices" element={<BookingService/>}/>
        <Route path="/user/paymentDetails" element={<PaymentDetails/>}/>
        <Route path="/user/statusServices" element={<StatusService/>}/>
        <Route path="/user/userProfile" element={<UserProfile/>}/>
        <Route path="/user/viewServices" element={<ViewServices/>}/>
        <Route path="/user/registerform" element={<RegistrationForm/>} />

        </Route>

      </Routes>
    </Router>

    </>
  );
}

export default App;
